import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './components/Home';

const App = () => {
	return (
		<Router>
			<div className="App">
				<h1>React Router</h1>
			</div>
			<Routes>
				<Route path="/" element={<Home />} />
				<Route path="products" element={<h2>Products</h2>} />
			</Routes>
		</Router>
	);
};

export default App;
